    max_iter = 100
    x = 0.0
    for _ in range(max_iter):
        f = poly(xs, x)
        if abs(f) < tolerance:
            return x
        df = 0.0
        for i in range(1, len(xs)):
            df += i * xs[i] * math.pow(x, i-1)
        x = x - f / df
