def find_zero(xs: list):
    n = len(xs)
    if n == 2:
        return -xs[0] / xs[1]

    derivative_coeffs = [i * xs[i] for i in range(1, n)]
    x = 0.0
    for _ in range(100):
        f_x = poly(xs, x)
        if abs(f_x) < 1e-10:
            return x
        f_prime_x = poly(derivative_coeffs, x)
        if abs(f_prime_x) < 1e-10:
            break
        x -= f_x / f_prime_x
    return x

