def do_algebra(operator, operand):
    precedence = {'+': 1, '-': 1, '*': 2, '//': 2, '**': 3}
    op_map = {
        '+': lambda a, b: a + b,
        '-': lambda a, b: a - b,
        '*': lambda a, b: a * b,
        '//': lambda a, b: a // b,
        '**': lambda a, b: a ** b
    }
    tokens = []
    for i in range(len(operand)):
        tokens.append(operand[i])
        if i < len(operator):
            tokens.append(operator[i])
    operands = []
    operators = []
    for token in tokens:
        if isinstance(token, int):
            operands.append(token)
        else:
            while operators and precedence.get(operators[-1], 0) >= precedence[token]:
                op = operators.pop()
                right = operands.pop()
                left = operands.pop()
                operands.append(op_map[op](left, right))
            operators.append(token)
    while operators:
        op = operators.pop()
        right = operands.pop()
        left = operands.pop()
        operands.append(op_map[op](left, right))
    return operands[0]

def solve(s):
    has_letter = False
    res = []
    for c in s:
        if c.isalpha():
            has_letter = True
            res.append(c.swapcase())
        else:
            res.append(c)
    return ''.join(reversed(res)) if not has_letter else ''.join(res)

def solve(s):
